export const Header = ()=>{
  return (
    <header>
        <nav>
            <a id="logo" href="#"><img src="https://picsum.photos/100/80" alt="logo"/></a>
            <ul>
                <a href="#"><li>Cadastro</li></a>
                <a href="#"><li>Login</li></a>
            </ul>
        </nav>
    </header>
  );
}
